d client to \"write a review\"\r\n\r\n  Scenario: Client gave a bad rating and review, and wrote a good suggestion for the program\r\n    When Client \"eyas\" gave a rating \"1\" and review \"it's bad! didn't lose weight at all!\" and suggestion \"Time per session is too little! More session time can save the program.\" for program \"Weight Loss Advanced\"\r\n    Then Apologize to the client and assure them that their suggestion will be considered\r\n    Then send client to \"main menu\"\r\n\r\n  Scenario: Client gave an okay rating and review, and wrote a good suggestion for the program\r\n    When Client \"eyas\" gave a rating \"5\" and review \"it's okay! didn't lose much weight though!\" and suggestion \"Needs more times per session!\" for program \"Weight Loss Advanced\"\r\n    Then Thank the client for the their review and say that you'll try to fix the problem\r\n    Then send client to \"main menu\"\r\n\r\n  Scenario: Client gave a good rating and review, and wrote a good suggestion for the program\r\n    When Client \"eyas\" gave a rating \"9\" and review \"Very good! made me lose weight easily!\" and suggestion \"Could use more time per session.\" for program \"Weight Loss Advanced\"\r\n    Then Thank the client for the their liking of the program and the suggestion\r\n    Then send client to \"main menu\"\r\n\r\n  Scenario: Client chose to go back or entered an invalid input format\r\n    When Client \"eyas\" entered \"go back\"\r\n    Then send client to \"main menu\"","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/Adamq\/IdeaProjects\/EyasAdamProject\/src\/features\/ClientFeatures\/ClientCompletedProgramsRating.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Client program rating and reviewing","description":"  Giving Clients the ability to rate and write reviews for programs that they already have completed...","children":[{"scenario":{"location" eStartedId":"225b23e7-f77e-4817-a585-85331c84f517","testStepId":"ed57194f-9460-4013-9e99-5ab1ca57de27","timestamp":{"seconds":1736244417,"nanos":519202300}}},{"testStepFinished":{"testCaseStartedId":"225b23e7-f77e-4817-a585-85331c84f517","testStepId":"ed57194f-9460-4013-9e99-5ab1ca57de27","testStepResult":{"duration":{"seconds":0,"nanos":0},"status":"PASSED"},"timestamp":{"seconds":1736244417,"nanos":519202300}}},{"testCaseFinished":{"testCaseStartedId":"225b23e7-f77e-4817-a585-85331c84f517","timestamp":{"seconds":1736244417,"nanos":520201900},"willBeRetried":false}},{"source":{"uri":"file:\/\/\/C:\/Users\/Adamq\/IdeaProjects\/EyasAdamProject\/src\/features\/ClientFeatures\/ClientCustomize.feature","data":"Feature: Customizing Client's profile data\r\n  To let clients add more personal info about themselves to their account like age, weight, BMI, goal BMI, goal weight, preferences and restrictions\r\n\r\n\r\n  Scenario: Client tried to update the value age to a non-numerical value\r\n    Given the username is \"adam\"\r\n    When client entered \"age\" \"80\" \"28\" \"23\" \"72\" \"diary-free food?\" \"well, diary\" for the values respectively\r\n    Then Tell the client that the age should be a numerical value\r\n    Then send client to \"change personal info\" customize\r\n\r\n  Scenario: Client tried to update the value age to a value outside the acceptable range\r\n    Given the username is \"adam\"\r\n    When client entered \"5\" \"80\" \"28\" \"23\" \"72\" \"diary-free food?\" \"well, diary\" for the values respectively\r\n    Then Tell the client that the age should be a value within the acceptable range\r\n    Then send client to \"change personal info\" customize\r\n\r\n\r\n  Scenario: Client tried to update the value weight to a non-numerical value\r\n    Given the username is \"adam\"\r\n    When client entered \"25\" \"mass\" \"28\" \"23\" \"72\" \"diary-free food?\" \"well, diary\" for the values respectively\r\n    Then Tell the client that the weight should be a numerical value\r\n    Then send client to \"change personal info\" customize\r\n\r\n\r\n  Scenario: Client tried to update the value weight to a value outside the acceptable range\r\n    Given the username is \"adam\"\r\n    When client entered \"25\" \"999\" \"28\" \"23\" \"72\" \"diary-free food?\" \"well, diary\" for the values respectively\r\n    Then Tell the client that the weight should be a value within the acceptable range\r\n    Then send client to \"change personal info\" customize\r\n\r\n\r\n  Scenario: Client tried to update the value BMI to a non-numerical value\r\n    Given the username is \"adam\"\r\n    When client entered \"25\" \"80\" \"good enough BMI (LOL)\" \"23\" \"72\" \"diary-free food?\" \"well, diary\" for the values respectively\r\n    Then Tell the client that the BMI should be a numerical value\r\n    Then send client to \"change personal info\" customize\r\n\r\n\r\n  Scenario: Client tried to update the value BMI to a value outside the acceptable range\r\n    Given the username is \"adam\"\r\n    When client entered \"25\" \"80\" \"2\" \"23\" \"72\" \"diary-free food?\" \"well, diary\" for the values respectively\r\n    Then Then Tell the client that the BMI should be a value within the acceptable range\r\n    Then send client to \"change personal info\" customize\r\n\r\n\r\n  Scenario: Client tried to update the value goal BMI to a non-numerical value\r\n    Given the username is \"adam\"\r\n    When client entered \"25\" \"80\" \"28\" \"good enough BMI (LOL)\" \"72\" \"diary-free food?\" \"well, diary\" for the values respectively\r\n    Then Tell the client that the goal BMI should be a numerical value\r\n    Then send client to \"change personal info\" customize\r\n\r\n\r\n  Scenario: Client tried to update the value goal BMI to a value outside the acceptable range\r\n    Given the username is \"adam\"\r\n    When client entered \"25\" \"80\" \"28\" \"2\" \"72\" \"diary-free food?\" \"well, diary\" for the values resp d":"dbe30143-269a-442d-ad7a-579fce01051f","testStepId":"d833395e-fee6-4901-bb66-8729c7b83218","timestamp":{"seconds":1736244421,"nanos":753941500}}},{"testStepFinished":{"testCaseStartedId":"dbe30143-269a-442d-ad7a-579fce01051f","testStepId":"d833395e-fee6-4901-bb66-8729c7b83218","testStepResult":{"duration":{"seconds":0,"nanos":0},"status":"PASSED"},"timestamp":{"seconds":1736244421,"nanos":753941500}}},{"testCaseFinished":{"testCaseStartedId":"dbe30143-269a-442d-ad7a-579fce01051f","timestamp":{"seconds":1736244421,"nanos":753941500},"willBeRetried":false}},{"source":{"uri":"file:\/\/\/C:\/Users\/Adamq\/IdeaProjects\/EyasAdamProject\/src\/features\/InstructorFeatures\/Notify-clients.feature","data":"Feature: Notify clients about changes to program\r\n  As a program manager\r\n  I want to notify clients about updates or removals in programs\r\n  So that they stay informed about relevant changes\r\n\r\n  # Scenario for notifying clients enrolled in \"program1\" about an update\r\n  Scenario Outline: Notify clients about updates to program1\r\n    Given I have an \"update\" in program \"program1\"\r\n    When I notify the clients enrolled in this program\r\n    Then the client \"<client>\" should receive the notification \"<notification>\"\r\n    And the system shows \"The notification has been sent\"\r\n    Examples:\r\n      | client | notification    |\r\n      | 1      | update          |\r\n      | 2      | update          |\r\n      | 3      | update          |\r\n      | 4      | update          |\r\n      | 5      | no notification |\r\n      | 6      | no notification |\r\n      | 7      | no notification |\r\n      | 8      | no notification |\r\n      | 9      | no notification |\r\n      | 10     | no notification |\r\n      | 11     | no notification |\r\n      | 12     | no notification |\r\n      | 13     | no notification |\r\n\r\n  # Scenario for notifying clients enrolled in \"program2\" about an update\r\n  Scenario Outline: Notify clients about updates to program2\r\n    Given I have an \"update\" in program \"program2\"\r\n    When I notify the clients enrolled in this program\r\n    Then the client \"<client>\" should receive the notification \"<notification>\"\r\n    And the system shows \"The notification has been sent\"\r\n    Examples:\r\n      | client | notification    |\r\n      | 1      | update          |\r\n      | 2      | update          |\r\n      | 3      | update          |\r\n      | 4      | update          |\r\n      | 5      | update          |\r\n      | 6      | update          |\r\n      | 7      | update          |\r\n      | 8      | no notification |\r\n      | 9      | no notification |\r\n      | 10     | no notification |\r\n      | 11     | no notification |\r\n      | 12     | no notification |\r\n      | 13     | no notification |\r\n\r\n  # Scenario for notifying clients enrolled in \"program3\" about a removal\r\n  Scenario Outline: Notify clients about removals from program3\r\n    Given I have an \"remove\" in program \"program3\"\r\n    When I notify the clients enrolled in this program\r\n    Then the client \"<client>\" should receive the notification \"<notification>\"\r\n    And the system shows \"The notification has been sent\"\r\n    Examples:\r\n      | client | notification    |\r\n      | 1      | update          |\r\n      | 2      | update          |\r\n      | 3      | update          |\r\n      | 4      | update          |\r\n      | 5      | update          |\r\n      | 6      | update          |\r\n      | 7      | update          |\r\n      | 8      | remove          |\r\n      | 9      | remove          |\r\n      | 10     | remove          |\r\n      | 11     | no notification |\r\n      | 12     | no notification |\r\n      | 13     | no notification |\r\n\r\n  # Scenario for notifying clients enrolled in \"program1\" about a removal\r\n  Scenario Outline: Notify clients about removals from program1\r\n    Given I have an \"remove\" in program \"progra
